import React from 'react';
import logo from './logo.svg';
import './App.css';
import taskMaster from './pictures/taskMaster.jpg'


function App() {
  return (
    <div className="App">
    <h1>Welcome to TaskMaster-5000</h1>
    <img className="logo" src={taskMaster}></img>
    </div>
  );
}

export default App;
